import './main.css';
import MU8BitLogo from './mu_pixel_logo_8x.png';
import MUFullLogo from './mu_dummy_logo_512px.png';

import { ScrollIndicator } from '@src/ui/common/element/scrollIndicator';

const HomeIndexSection = props => <section className='homeIndexSection'>
  <ScrollIndicator style={{ visibility: 'hidden', }} />
  <img className='targetImgLogo' src={MUFullLogo} alt='MUsoftware Logo' />
  <h1 className='targetTextLogo' {...props}>이준영 | <img className='targetTextLogoEng' src={MU8BitLogo} alt='MUsoftware' /></h1>
  <ScrollIndicator />
</section>;

export { HomeIndexSection }
